VALUES ('3250391456123', 'Adelie Ananas Surgele', 'INGREDIËNT: Ananas. INFORMATIE: Ten minste houdbaar tot einde en lotnr.: zie de datum vermeld op de bovenkant van het bakie. HOUDBAARHEID: Vriesvak van de koelkast ** (-120C): 3 dagen. Vriezer *** (-180C): tot de datum vermeid de bovenkant van het bakie. NA ONTDOOIING NIET OPNIEUW INVRIEZEN. BEREIDINGSTIPS: Voor koude bereidingen de vruchten Uit hun verpakking halen en ze langzaam laten ontdooien in de koelkast (ongeveer 12 UIJr). Voor warme bereidingen de vruchten zo gebruiken. CONSUMENTENDIENST ADÉLIE www.intermarche.be O ANANAS ULTRACONGELADO ORIGEM COSTA-RICA INGREDIENTE.• Anands. INFORMAÇÔES: Consumir de preferência antes do fim de e lote no: ver na saqueta. CONSERVAÇÂO: Congelador do frigorifico** (-120C): 3 dias. Congelador *** (-180C): até à data de durabilidade minima indicada na parte superior da embalagem. NAO VOLTAR A CONGELAR UMA va INICIADO O PROCESSO DE DESCONGELAÇÂO. CONSELHOS DE PREPARAÇÂO: para os preparados frios, retirar a fruta da embalagem e deixd-la descongelar lentamente no frigorifico (aproximadamente 12 horaS). Para os preparados quentes, Utilizar a fruta sem descongelar. SERVIÇO DE APOIO AO CONSUMIDOR ADÉLIE 159 - Bugalhos - 2384-004 Alcanena - Portuaal.', 'https://static.openfoodfacts.org/images/products/325/039/145/6123/front_fr.9.400.jpg', '0.3', '0.1', '12.4', '12.4', '', '0.7', '0.008', '0.0031496062992126', '', '1');

