VALUES ('3250391553310', 'Odyssee Panes Cabillaud', 'Préparation à base de cabillaud 65% : cabillaud 56% (poisson), eau, amidon modifié de pomme de terre, fibre de pomme de terre, sel, épaississant E461. (% exprimés sur la totalité du produit). Panure 35% : chapelure (farine de blé, levure, sel), enrobant (eau, farine de blé), huiles végétales (tournesol, colza). Traces éventuelles de : lait, œuf et mollusques. INFORMATIONS : À consommerjusqutau : voir sur l\'étiquette avant. À conserver entre OOC et +40C avant et après ouverture. Après ouverture à consommer dans les 72 heures. Conditionné sous atmosphère protectrice. Malgré tout le soin apporté à la préparation de ce produit, la présence exceptionnelle darête reste possible. CONSEILS DE PRÉPARATION : Sans ajout de matière grasse - AU four traditionnel après préchauffage à 1800C (thermostat 6) : 8 à 10 minutes. À la poêle préchauffée : 3 à 4 minutes environ de chaque côté à feu moyen', 'https://static.openfoodfacts.org/images/products/325/039/155/3310/front_fr.6.400.jpg', '10', '1', '19', '1', '', '11', '0.6', '0.236220472440945', '', '1');

